import React, { useState } from "react";
import {
  IconButton,
  InputAdornment,
  Grid,
  DialogContent,
  Paper,
  makeStyles,
  TextField,
  Button,
} from "@material-ui/core";
import { IDialogeDataMobile } from "./appFolder-Interfaces";
import { useSpring, animated } from "react-spring";
import ModalFormSignupError from "./ModalFormSignupError";
import ModalFormLoginError from "./ModalFormLoginError";
import ServerError from "./ServerError";
import VisibilityOffIcon from "@material-ui/icons/VisibilityOff";
import VisibilityIcon from "@material-ui/icons/Visibility";

function MobileModalLog(DialogeDataMobile: IDialogeDataMobile) {
  const [mobileZoom, setMobileZoom] = useState<boolean>(false);
  ///
  ///
  ///
  /// MATERIAL UI  CUSTOM STYLES
  var useStyleModal = makeStyles(() => ({
    containerStyle: {
      width: DialogeDataMobile.imageReal,
      height: "auto",
      boxShadow: "0 5px 16px rgba(0, 0, 0, 0.2)",
      color: "#000000",
      position: "relative",
      zIndex: 10,
      borderRadius: DialogeDataMobile.borderGrid,
    },
    imageStyle: {
      opacity: DialogeDataMobile.opacityFixedModalImage,
      cursor: "pointer",
      objectFit: "contain",
      width: "100%",
      height: "100%",
      borderRadius: "0px",
      padding: "0px",
    },
  }));
  var classes = useStyleModal();
  return (
    <DialogContent
      className="fadermodal FormDialog-container-mobile dontallowhighlighting"
      style={{
        overflow: "auto",
        cursor: "pointer",
        padding: "0px",
        zIndex: 100,
      }}
    >
      <ServerError
        device="mobile"
        serverEmojiplain={DialogeDataMobile.serverEmojiplain}
        setServerErrorData={DialogeDataMobile.setServerErrorData}
        serverErrorDisplay={DialogeDataMobile.serverErrorDisplay}
        serverErrorData={DialogeDataMobile.serverErrorData}
        darkmode={DialogeDataMobile.darkmode}
      />
      <animated.div style={DialogeDataMobile.modalanimation}>
        <Paper
          className={DialogeDataMobile.PaperStyle}
          style={{
            cursor: "default",
          }}
        >
          <Grid container>
            <Grid item xs={12}>
              <img
                onClick={() => setMobileZoom(!mobileZoom)}
                onLoad={DialogeDataMobile.onimageload}
                src={DialogeDataMobile.showimage}
                className={classes.imageStyle}
                alt="Logsmall"
              />
            </Grid>
            <Grid item xs={12} className={mobileZoom ? "" : "smallMobile"}>
              <Paper
                className={DialogeDataMobile.PaperStyle}
                style={{
                  cursor: "default",
                  height: "80vh",
                  borderRadius: "0px",
                  borderTopRightRadius: "10px",
                  borderTopLeftRadius: "10px",
                }}
              >
                <Grid xs={12} item className="formholder">
                  {DialogeDataMobile.formtype ? (
                    <Grid
                      item
                      xs={12}
                      className=""
                      style={{ marginTop: "-1.5px" }}
                    >
                      <ModalFormLoginError
                        type={true}
                        device="mobile"
                        ErrorDisplay={
                          DialogeDataMobile.errorsLoginInputedUsername
                        }
                        darkmode={DialogeDataMobile.darkmode}
                        WidthHolder={DialogeDataMobile.WidthHolder}
                      />

                      <TextField
                        style={{
                          transform: "scale(0.94)",
                          width: "100%",
                          paddingBottom: "60px",
                        }}
                        label="Username"
                        margin="normal"
                        type="text"
                        onChange={DialogeDataMobile.updateLoginvalues}
                        name="inputedUsername"
                        value={DialogeDataMobile.rawLogininputedUsername}
                        variant="standard"
                      />

                      <TextField
                        size="small"
                        style={{
                          transform: "scale(0.94)",
                          width: "100%",
                          paddingBottom: "40px",
                          zIndex: 1,
                        }}
                        label="Password"
                        onChange={DialogeDataMobile.updateLoginvalues}
                        type={
                          DialogeDataMobile.loginShowPassword
                            ? "text"
                            : "password"
                        }
                        name="inputedPassword"
                        value={DialogeDataMobile.rawLogininputedPassword}
                        variant="standard"
                        InputProps={{
                          endAdornment: (
                            <InputAdornment position="end">
                              <IconButton
                                onClick={
                                  DialogeDataMobile.ShowLoginPasswordForaWhile
                                }
                                onMouseDown={
                                  DialogeDataMobile.ShowLoginPasswordForaWhile
                                }
                                aria-label="toggle password visibility"
                              >
                                {DialogeDataMobile.loginShowPassword ? (
                                  <VisibilityIcon />
                                ) : (
                                  <VisibilityOffIcon />
                                )}
                              </IconButton>
                            </InputAdornment>
                          ),
                        }}
                      />
                      <ModalFormLoginError
                        type={false}
                        ErrorDisplay={
                          DialogeDataMobile.errorsLoginInputedPassword
                        }
                        device="mobile"
                        darkmode={DialogeDataMobile.darkmode}
                        WidthHolder={DialogeDataMobile.WidthHolder}
                      />

                      <Grid container style={{ marginTop: "40px", zIndex: 2 }}>
                        <Grid item xs={4}></Grid>
                        <Grid item className="buttonpad buttonshake" xs={4}>
                          <Button
                            onClick={DialogeDataMobile.logmein}
                            className={DialogeDataMobile.loginclass}
                            fullWidth={true}
                            variant="outlined"
                            size="large"
                            color="primary"
                          >
                            Log In
                          </Button>
                        </Grid>{" "}
                      </Grid>
                    </Grid>
                  ) : (
                    <Grid
                      item
                      xs={12}
                      className=""
                      style={{ marginTop: "-1.5px" }}
                    >
                      <ModalFormSignupError
                        device="mobile"
                        ErrorType={0}
                        textField="email"
                        errorFormChecking={
                          DialogeDataMobile.errorFormCheckinginputedEmail
                        }
                        WidthHolder={DialogeDataMobile.WidthHolder}
                        darkmode={DialogeDataMobile.darkmode}
                        type={true}
                        cantPassBadEmail={DialogeDataMobile.cantPassBadEmail}
                        ErrorDisplay={DialogeDataMobile.emailErrorDisplay}
                        ErrorData={DialogeDataMobile.emailErrorData}
                      />

                      <TextField
                        size="small"
                        style={{
                          transform: "scale(0.94)",
                          width: "100%",
                          paddingBottom: "40px",
                        }}
                        label="Email"
                        type="email"
                        onChange={DialogeDataMobile.updateSignvalues}
                        name="inputedEmail"
                        value={DialogeDataMobile.rawSignupValuesinputedEmail}
                        variant="standard"
                      />

                      <ModalFormSignupError
                        device="mobile"
                        ErrorType={
                          DialogeDataMobile.errorsSignupValuesinputedUsername
                        }
                        textField="username"
                        errorFormChecking={
                          DialogeDataMobile.errorFormCheckinginputedUsername
                        }
                        WidthHolder={DialogeDataMobile.WidthHolder}
                        darkmode={DialogeDataMobile.darkmode}
                        type={true}
                        cantPassBadEmail={DialogeDataMobile.cantPassBadEmail}
                        ErrorDisplay={DialogeDataMobile.usernameErrorDisplay}
                        ErrorData={DialogeDataMobile.usernameErrorData}
                      />
                      <TextField
                        size="small"
                        style={{
                          transform: "scale(0.94)",
                          width: "100%",
                          paddingBottom: "70px",
                        }}
                        label="Username"
                        type="text"
                        onChange={DialogeDataMobile.updateSignvalues}
                        name="inputedUsername"
                        value={DialogeDataMobile.rawSignupValuesinputedUsername}
                        variant="standard"
                      />

                      <TextField
                        size="small"
                        style={{
                          transform: "scale(0.94)",
                          width: "100%",
                          paddingBottom: "32px",
                        }}
                        label="Password"
                        type={
                          DialogeDataMobile.signupShowPassword
                            ? "text"
                            : "password"
                        }
                        onChange={DialogeDataMobile.updateSignvalues}
                        name="inputedPassword"
                        value={DialogeDataMobile.rawSignupValuesinputedPassword}
                        variant="standard"
                        InputProps={{
                          endAdornment: (
                            <InputAdornment position="end">
                              <IconButton
                                onClick={
                                  DialogeDataMobile.ShowSignupPasswordForaWhile
                                }
                                onMouseDown={
                                  DialogeDataMobile.ShowSignupPasswordForaWhile
                                }
                                aria-label="toggle password visibility"
                              >
                                {DialogeDataMobile.signupShowPassword ? (
                                  <VisibilityIcon />
                                ) : (
                                  <VisibilityOffIcon />
                                )}
                              </IconButton>
                            </InputAdornment>
                          ),
                        }}
                      />
                      <ModalFormSignupError
                        device="mobile"
                        ErrorType={0}
                        textField="password"
                        errorFormChecking={
                          DialogeDataMobile.errorFormCheckinginputedPassword
                        }
                        darkmode={DialogeDataMobile.darkmode}
                        WidthHolder={DialogeDataMobile.WidthHolder}
                        type={false}
                        cantPassBadEmail={DialogeDataMobile.cantPassBadEmail}
                        ErrorDisplay={DialogeDataMobile.passwordErrorDisplay}
                        ErrorData={DialogeDataMobile.passwordErrorData}
                      />

                      <Grid
                        container
                        style={{ marginTop: "40px", zIndex: 2 }}
                        className="modal-hold-signup"
                      >
                        <Grid item xs={4}></Grid>
                        <Grid item className="buttonpad buttonshake" xs={4}>
                          <Button
                            className={DialogeDataMobile.signupclass}
                            onClick={DialogeDataMobile.signmeup}
                            fullWidth={true}
                            variant="contained"
                            size="large"
                            color="secondary"
                          >
                            Sign Up
                          </Button>
                        </Grid>{" "}
                      </Grid>
                    </Grid>
                  )}
                </Grid>
              </Paper>
            </Grid>
          </Grid>
        </Paper>
      </animated.div>
    </DialogContent>
  );
}

export default MobileModalLog;
